insert  into `post`(`post_id`,`title`,`content`,`created_at`,`image`) values 
(1,'Rayakan Tahun Baru Bareng Film Dusun Mayit di Bioskop!','\r\nBuat kamu para pemburu adrenalin, film Dusun Mayit resmi tayang perdana di seluruh bioskop pada hari ini, 31 Desember 2025! Film ini menjadi perbincangan hangat karena menandai kembalinya Amanda Manopo ke jagat sinema horor. Digarap oleh sutradara bertangan dingin, Rizal Mantovani, film ini bukan sekadar fiksi belaka, melainkan hasil adaptasi dari thread horor yang sempat viral di media sosial X milik @JeroPoint. Perpaduan antara nama besar aktor dan cerita yang sudah punya basis penggemar kuat membuat film ini jadi tontonan wajib untuk menutup tahun.\r\n\r\nTidak main-main produksi film in mengambil lokasi langsung di lereng Gunung Welirang. Amanda Manopo dan jajaran pemeran lainnya harus berjuang melawan cuaca ekstrem demi mendapatkan atmosfer yang autentik. Memberikan kisah yang dekat dengan mitos pendakian di Indonesia tentang sekelompok anak muda yang terjebak di desa gaib setelah tanpa sengaja karena melanggar adat setempat. Kamu akan diajak merasakan sensasi tersesat di dimensi lain yang penuh misteri yang menegangkan.\r\n\r\nDiperankan oleh nama-nama besar yang sudah tidak perlu lagi diragukan kemampuannya, langsung pesan tiket nonton Dusun Mayit kalian sekarang lewat aplikasi TIX ID untuk mendapatkan sensasi nonton terbaik dan jangan lupa un tuk memasukan film favorit kalian ke dalam watchlist!','2026-01-01 17:16:11','https://upload.wikimedia.org/wikipedia/commons/thumb/e/ed/Rio_New_Year_Fireworks.jpg/500px-Rio_New_Year_Fireworks.jpg'),
(2,'5 Rekomendasi Film Indonesia Wajib Tonton Bulan Januari','Bulan Januari 2026 dibuka dengan deretan film Indonesia berkualitas dari berbagai genre, mulai dari horor, drama keluarga, hingga thriller psikologis. Berikut lima rekomendasi film lokal yang wajib masuk daftar tontonan kamu di awal tahun.','2026-01-03 14:30:00','https://upload.wikimedia.org/wikipedia/commons/thumb/2/2f/Sala_de_cine.jpg/960px-Sala_de_cine.jpg'),
(3,'Tips Hemat Nonton di Bioskop Favoritmu','Nonton film di bioskop bisa jadi pengalaman yang menyenangkan, tapi juga bisa menguras kantong. Berikut beberapa tips untuk menikmati film favoritmu tanpa harus merogoh kocek terlalu dalam. \r\n\r\n1. Manfaatkan Promo dan Diskon: Banyak bioskop menawarkan promo khusus pada hari-hari tertentu atau untuk pembelian tiket secara online. Jangan lupa cek aplikasi atau website bioskop favoritmu untuk mendapatkan penawaran terbaik.\r\n\r\n2. Pilih Waktu Tayang yang Tepat: Biasanya, tiket bioskop lebih murah pada hari kerja atau di sesi pagi dan siang hari. Hindari akhir pekan atau malam hari jika ingin lebih hemat.\r\n\r\n3. Bawa Cemilan dari Rumah: Meskipun banyak bioskop yang melarang membawa makanan dari luar, beberapa tempat memperbolehkan cemilan kecil seperti popcorn atau minuman ringan. Ini bisa menghemat pengeluaranmu dibandingkan membeli di dalam bioskop.\r\n\r\n4. Gunakan Kartu Keanggotaan: Beberapa bioskop memiliki program keanggotaan yang memberikan diskon khusus atau poin reward setiap kali kamu membeli tiket. Manfaatkan ini untuk mendapatkan harga lebih murah di kunjungan berikutnya.\r\n\r\n5. Nonton Bareng Teman: Ajak teman-temanmu untuk nonton bersama dan bagi biaya tiket serta cemilan. Selain lebih seru, ini juga bisa mengurangi beban biaya per orang.\r\n\r\nDengan mengikuti tips-tips di atas, kamu bisa tetap menikmati pengalaman menonton di bioskop tanpa harus khawatir soal budget. Selamat menonton!','2026-01-05 10:00:00','https://upload.wikimedia.org/wikipedia/commons/thumb/e/e2/Cinema_popcorn_bucket.jpg/960px-Cinema_popcorn_bucket.jpg');
